<template>
  <input type="range" v-model="size">
  <br>
  <img ref="image" src="data:image/png;base64,">
</template>

<script>
export default {
  data() {
    return {
      size: 0
    }
  },
  watch: {
    size(newSize, oldSize) {
      console.log("Cambió size", newSize, oldSize)
      console.log(this.$refs.image)
      this.$refs.image.style.borderRadius = newSize + "px"
    }
  }
}
</script>